// 1573. Number of Ways to Split a String

console.clear()

function numWays(s: string): number {
  let oneAmount = 0

  for (let i = 0; i < s.length; i++) {
    if (s[i] === '1') {
      oneAmount++
    }
  }

  if (oneAmount % 3 !== 0) {
    return 0
  }

  const partOneAmount = oneAmount / 3

  if (partOneAmount === 0) {
    return (1 + s.length - 2) * (s.length - 2) / 2  % (Math.pow(10, 9) + 7)
  }

  let left = 0
  let right = s.length - 1
  let leftOneAmount = 0
  let rightOneAmount = 0

  while (leftOneAmount < partOneAmount || rightOneAmount < partOneAmount) {
    if (s[left] === '1' && leftOneAmount < partOneAmount) {
      leftOneAmount++
    }

    if (s[right] === '1' && rightOneAmount < partOneAmount) {
      rightOneAmount++
    }

    if (leftOneAmount < partOneAmount) {
      left++
    }

    if (rightOneAmount < partOneAmount) {
      right--
    }
  }

  let leftNextOne = right
  let rightNextOne = left

  for (let i = left + 1; i < right; i++) {
    if (s[i] === '1') {
      leftNextOne = i
      break
    }
  }

  for (let i = right - 1; i > left; i--) {
    if (s[i] === '1') {
      rightNextOne = i
      break
    }
  }

  console.log(left, leftNextOne, rightNextOne, right)

  return (leftNextOne - left) * (right - rightNextOne) % (Math.pow(10, 9) + 7)
}

